#* {{quote-book|fr|year=1612|author=Louis Dorléans|title=La plante Humaine sur le Trespas du roy Henry le Grand|pageurl=http://books.google.com/books?id=pB0JqKvGmbMC&hl=es&pg=PA14|pages=14–15
|passage=Car l’hilippe, bien qu’il fut vn grād Prince, & '''præpoſé''' ſur de grāds peuples & belliqueux, & en vn mot, qu’il fuſt pere d’Alexādre depuis Monarque de l’vniuers, ſi eſt‐ce que le iour des nopces de Cleopatre ſa fille , comme il ne penſoit qu’ à des triumphes & à des plaiſirs , & comme il s’en alloit aux jeux voir reciter vne tragedie, & qu’il paſſoit par vn deſtroit , eſtant en caroſſe au milieu de ſon fils & de ſon gendre, qui eſtoient deux Alexandres , voyla qu’vn jeune Gentil‐hōme nōmé Pauſanias, le guetta, n’ayant aucunes gardes, & luy donna ſans qu’il s’en doutaſt le triſte coup de la mort.}}
